import React, { useState } from "react";
import Calendar from "react-calendar";
import "react-calendar/dist/Calendar.css";

function Cal() {
  const [date, setDate] = useState(new Date());

  const onChange = (newDate) => {
    setDate(newDate);
  };

  const calendarStyle = {
    border: "3px solid #584d9f",
    borderRadius: "5px",
  };

  return (
    <div>
      <h2>MY CALENDAR</h2>
      <br></br>
      <br></br>
      <Calendar
        onChange={onChange}
        value={date}
        style={calendarStyle} // Add inline styling here
      />
    </div>
  );
}

export default Cal;
